import React, { Component } from 'react'
import logo from '../../img/puma-logo.svg';
import Background from '../../img/img-1.jpg';
import Menu from './../Menu/Menu';
import './App.sass';

const menu = [
    {
        text: 'Studio'
    },
    {
        text: 'Partners'
    },
    {
        text: 'Media'
    },
    {
        text: 'user'
    }
]

export class App extends Component {
	render() {
		return (
			<div id="main"
				 styles={{ backgroundImage: `url(${Background})` }}
			>
				<div className="navbar">
					<header className="menu">
						<div className="logo">
							<img src={logo} className="App-logo" alt="logo" />
						</div>
						<nav>
							<ul>
								<Menu items={menu} />
							</ul>
						</nav>
					</header>
				</div>
			</div>
		)
	}
}

export default App;
